import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and type a product name
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max');

    // Take a screenshot after entering the product name
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for the product to be visible and take a screenshot
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_displayed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_product_displayed.png'));

    // Click on the first product to view details
    await page.click('.product-card');

    // Wait for the product detail to load
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take a screenshot of the product detail
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));

    // Click the add to cart button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.click('.add-to-cart');

    // Wait for the cart confirmation to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Extract confirmation message
    const confirmationMessage = await page.innerText('.notification.success');

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData: { confirmationMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
